public class InnerAlarmModelAlarmCapabilitiesFactory(Action<Humidifier.IoTEvents.AlarmModelTypes.AlarmCapabilities> factoryAction = null) : SubResourceFactory<Humidifier.IoTEvents.AlarmModelTypes.AlarmCapabilities>
{

    internal InnerAlarmModelAcknowledgeFlowFactory AcknowledgeFlowFactory { get; set; }

    internal InnerAlarmModelInitializationConfigurationFactory InitializationConfigurationFactory { get; set; }

    protected override Humidifier.IoTEvents.AlarmModelTypes.AlarmCapabilities Create()
    {
        var alarmCapabilitiesResult = CreateAlarmCapabilities();
        factoryAction?.Invoke(alarmCapabilitiesResult);

        return alarmCapabilitiesResult;
    }

    private Humidifier.IoTEvents.AlarmModelTypes.AlarmCapabilities CreateAlarmCapabilities()
    {
        var alarmCapabilitiesResult = new Humidifier.IoTEvents.AlarmModelTypes.AlarmCapabilities();

        return alarmCapabilitiesResult;
    }
    public override void CreateChildren(Humidifier.IoTEvents.AlarmModelTypes.AlarmCapabilities result)
    {
        base.CreateChildren(result);

        result.AcknowledgeFlow ??= AcknowledgeFlowFactory?.Build();
        result.InitializationConfiguration ??= InitializationConfigurationFactory?.Build();
    }

} // End Of Class

